script:
frappe.ui.form.on('Supplier', {
onload: function(frm) {
		frm.list_route = "Tree/Supplier";

		//get query select item group
		frm.fields_dict['parent_supplier'].get_query = function(doc,cdt,cdn) {
			return{
				filters:[
					['Supplier', 'is_group', '=', 1],
					['Supplier', 'name', '!=', doc.supplier_name]
				]
			}
		}
}
})
